import React from 'react'
import './Admincss.css';
import { Link } from 'react-router-dom';
import Nav from './components/Nav';
import Adminpage from './Adminpage';

export default function Adminlogin() {
  
  const usertype = ['Public', 'Admin', 'Doctor/Nurse']
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    usertype: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData)
    axios.post('http://localhost:8000/signup', formData)
      .then(response=> {
         <Navigate to='/'></Navigate>
      })
      .catch(error => {
        console.error('Error:', error);
      });
  };


  return (
    <div className='adm'>
      <div>
        <nav className="navbar">
          <ul>Hospitals</ul>
          <ul>Privacy Policy</ul>
          <ul>Contact Us</ul>
        </nav>
        <div className="logo">
          <h1>AIIMS<span> Dashboard.</span></h1>
        </div>
      </div>
      <div className='log'>
        <h1>Login</h1>
        <div className='mnq'>
          <label className='lb1'>Email</label><br />
          <input placeholder='Enter your email' type='email' className='inp1' /><br /><br />
          <label className='lb1'>Password :</label><br />
          <input placeholder='Enter Password' type='password' className='inp1' /><br />
          <Link to="/Adminpage" className='ln1'>Login</Link>
          <br />
          <label>Dont have an account ?<Link to='/signup'> Sign Up</Link></label>
        </div>

      </div>
    </div>
  )
}
